import React from "react";
import Header from "./Header";
import CreateNote from "./CreateNote";
import Notes from "./Notes";
import Footer from "./Footer";

const App = () => {
    return (
        <>
            <Header />
            <hr />
            <div className="notes">
                <CreateNote />
                <Notes />
            </div>
            <Footer />
        </>
    );
}

export default App;
